    false,nt"url": null,nt"notes": "The Commonwealth of the Northern Mariana
    Islands' (CNMI) interagency marine monitoring team conducts surveys on reef flat
    areas on the islands of Saipan, Tinian and Rota in an effort to assess change in
    benthic communities over time. The program encourages volunteer participation from
    government and public sector under the supervision of professional government biologists.
    The data collected include benthic cover and invertebrate abundance. Coral community
    composition was added to the surveys in 2009.",nt"license_title": null,nt"extras":
